import React, { useState } from 'react'
import Charts from 'react-apexcharts'

const CardGraph = () => {
    const [Data] = useState(
        {
           options : {
                background:"fff",
                chartOptions:{
                    labels:["Apple","Banana","Mango"]
                }
           },
           series: [11,45,79],
        }
    )
    return (
        <div>
              <Charts options={Data.options} series={Data.series}  width="350" type='donut' />
        </div>
    )
}

export default CardGraph
